import React from 'react'
import { Navigate } from 'react-router-dom';

export default function PrivateRoute({ isAuthenticated, children }) {
    console.log(children, "this")

    if (!isAuthenticated) {
        return <Navigate to="/" replace />
    }

    return children
}
